            alignment="center"
            m={25}

        >
            <Box m={25} component="span" sx={{p: 2, border: '1px dashed grey' , width:200,height:'200'}}>
                <h2>asa</h2>
            </Box>   

            <Box m={25} component="span" sx={{p: 2, border: '1px dashed grey'}}>
